</audio>
<script>

  var value = 0;

  function decrease() {
    setTimeout(function () {
      if (value > 0) {
        value--;
      }
      update();
      decrease();
    }, (100 - value) * 30)
  }

  decrease();

  function update() {
    var progress = document.getElementById("progress");

    if (progress) {
      progress.value = value;
      var audio = document.getElementById("bg");
      audio.volume = 0.2;
      audio.play();
      audio.playbackRate = Math.max(0.5, value / 20);
      if (value === 0) {
        audio.pause();
      }

      var button = document.getElementById("button");
      v = ((75 - value) / 75) * 200;
      button.style.background = "rgba(255," + v + "," + v + ")";
    }

    var label;
    if (value > 5) {
        label = "more!";
    }
    if (value > 15) {
        label = "don't stop!";
    }
    if (value > 30) {
        label = "too much!";
    }
    if (value > 45) {
        label = "stop it!";
    }
    if (value > 65) {
        label = "no";
        for (var i = 65; i < value; i++) {
          label += "o";
        }
        label = label + "!";
    }
    if (label) {
        document.getElementById("button").innerText = label;
    }

    if (value >= 75) {
      document.body.removeChild(document.getElementById("main"));
      document.body.className = "done";

      var bg = document.getElementById("bg");
      var done = document.getElementById("done");
      bg.pause();
      done.play();

      setTimeout(function () {
        document.body.className = "finish";
      }, 5000);
    }
  }

  function clickMe() {
    if (value < 100) {
      value++;
    }
    update();
  }

</script>
